I&amp;#039;d Watch It If It Was On TV., 28 April 2005

Author: Spitney Beers from United States 

Yeah, it was a bad movie, but I knew that when I rented it. I knew exactly what I was getting and if you&amp;#039;re honest with yourself, you did, too.

There&amp;#039;s not a whole lot to the story, but then again, there&amp;#039;s not a lot of story to Survivor either, the movie it&amp;#039;s spoofing. I was surprised that they did go into a lot of character development. I knew all the girls names and personalities. If there was one thing they did right, it was that.

Six girls are competing in a Survivor game on the island of Butta Cheeka for the grand prize of a &quot;buttload of money&quot;. Cliff Probate (Lenny Juliano) is the host, spoofing Jeff Probst. Cliff was funny due to the fact that he knew he was on an island with 6 hot girls and thought it would be his big chance, but even on a island with no other men, he can&amp;#039;t make it happen.

As for the girls, there is Babbette Laroux (Shauna O&amp;#039;Brien), a French woman looking to get her green card. She has a killer body and a secret, and it&amp;#039;s not that her French accent is horrible. Also, my favorite, is Ruby Sparrow (Julie K. Smith). Ruby is an ex-marine (or Navy SEAL, depending on which line she&amp;#039;s saying) with a rough attitude and most adept to survive. She, too, has a killer body.

Dallas Wigglesbutt (Tess Broussard) is the outdoors athletic type. Funny how they picked the most out of shape girl to play this part. I&amp;#039;m sure they could have found a better girl here but at least they didn&amp;#039;t have the camera on her too often. Angela Adams (Aimee Sweet) is the ditsy professional surfer who likes to celebrate &quot;Naked Day&quot;. I can&amp;#039;t fault her for that. Cheryl Church (Alexus Winston) is the religious girl who thanks God for her lipstick and other luxuries while on the island. And, finally, we have Monica Snatch (Aria Giovanni), a bitchy psychiatrist whose voice reminds me of Jackie from That 70&amp;#039;s Show.

So if you&amp;#039;re going to watch a bad movie, this is the kind you want to watch. It may have been boring at times, but at least the women were top notch, except for one. I doubt anyone can mistake this for a serious movie, but for those of you who do, you need to know what you&amp;#039;re renting. If you have low expectations, it&amp;#039;s not that bad.
